@ilanfri and I have been working on this to analyse travel to school OD data. It does not seem like the most efficient implementation but certainly works, as illustrated by this visualisation of travel to school in Leeds:

![rplot](https://cloud.githubusercontent.com/assets/1825120/19083967/69e29928-8a5c-11e6-8fb5-7a3569493d27.png)

Please review @richardellison and test the new example data.

Just discovered that some places have fares in there. Not sure this is the best way to implement this (please review) and happy to change things but good to know we can extract this for some places, e.g. Sao Paulo, with:

